import React from "react";

function Intro() {
  return (
    <div className="h-[80vh] bg-primary flex flex-col items-start justify-center gap-8 py-10">
      <h1 className="text-black text-xl"> Hi, I am </h1>
      <h1 className="text-7xl sm:text-3xl text-secondary font-semibold">Kelvin Kho</h1>
      <h1 className="text-5xl sm:text-3xl text-black font-semibold">
        I code stuff for fun.
      </h1>
      <p className="text-black w-2/3 text-xl">
        I am a Backend Developer that is trying to learn more about programming.
      </p>
      <button className="border-2 border-tertiary text-black px-1 py-3 rounded">Get Started</button>
    </div>
  );
}

export default Intro;
